import React, {useState,useEffect} from 'react';
import axios from 'axios';
import {Link, useParams, useNavigate} from 'react-router-dom';
import '../App.css';

const Repos = ()=>{
    let {pagenum} = useParams();
    const [gameData, setGameData] = useState(undefined);
    const [page, setPage] = useState(parseInt(pagenum));
    const [disable, setDisable] = useState(false);
    const [error, setError] = useState(false);
    const [loading, setLoading] = useState(true);
    const navigate = useNavigate();

    useEffect(() => {
        setPage(parseInt(pagenum));
        setError(false);
        const fetchData = async () => {
            try{
                const { data } = await axios.get(`https://api.github.com/orgs/Netflix/repos?sort=stars?page=${pagenum}`);
                console.log(data.results);
                setGameData(data.results);
                setLoading(false);
            }catch(e){
                console.log(e);
                setError(true);
            }
            try{
                const { data } = await axios.get(`http://localhost:4000/games/${page + 1}`);
                setDisable(false);
            }catch(e){
                setDisable(true);
            }
        }
        fetchData();
      }, [page, pagenum])




    return (
        <div>
            <h1>Hi and Welcome to the Repos!</h1>
            <p>This website uses the ticketmaster API to provide you with the 
                events, attractions, and venues available on the ticketmaster website.
                Using this API, you will be able to find all kinds of inforation here on an event,
                attraction, or venue such as pricing, limts, and dates. Start looking now by clicking one
                of the navigational menu buttons!
            </p>
            <br/>
            <p>This does remind me of a time where I when to an event that I bought the tickets in using ticketmaster. It was the summer of 2019 and I 
                went to MetLife Stadium to watch a big soccer game between Liverpool and Manchester City. The atmoshpere was fantasic and the goals were
                amazing. I even went to the hotel where the Liverpool players were staying at the day after the game and got to meet some of the players.
            </p>
        </div>
    )
}

export default Repos;
